import React from 'react'
import axios from 'axios';
import './Carouseler.css';
import { useState,useMemo } from 'react';
import collage from '../images/collage.jpeg'
const Carouseler = () => {
    const [images, setImages] = useState([]);

    const fetchAPI = async()=>{
    const response = await axios.get('https://api.unsplash.com/photos/?client_id=YbnWcUQHyapMRVl5x8yCOn_I9inhl0dTOpCfNjy99no');
    const data = response.data;
    setImages(data);
    }
    useMemo(
      fetchAPI,[]
    )
  return (
    <div>
       <div id="carouselExampleControls" class="carousel slide" data-coreui-ride="carousel">
  <div class="carousel-inner">
    <div class="carousel-item active">
      <img src={collage} class="gp" alt="..."/>

    </div>
    <div class="carousel-item">
      <img src={collage} class="gp" alt="..."/>

    </div>
    <div class="carousel-item">
      <img src={collage} class="gp" alt="..."/>

    </div>
  </div>
  <button class="carousel-control-prev" type="button" data-coreui-target="#carouselExampleControls" data-coreui-slide="prev">
    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Previous</span>
  </button>
  <button class="carousel-control-next" type="button" data-coreui-target="#carouselExampleControls" data-coreui-slide="next">
    <span class="carousel-control-next-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Next</span>
  </button>
</div>
    </div>
  )
}
export default Carouseler
